import {ApolloClient, InMemoryCache} from 'apollo-boost';

const client = new ApolloClient({
    uri: 'https://api.spacex.land/graphql/',
    cache: new InMemoryCache().restore(window.__APOLLO_STATE__)
});

export default client;
